import React, { useEffect, useState } from 'react';
import { useTheme } from '@mui/material/styles';
import BackgroundBox from '../../components/common/BackgroundBox';
import Typography from '@mui/material/Typography';
import ImageStepper from '../../components/landing/ImageStepper';
import Button from '@mui/material/Button';


function Landing() {
    return (
        <BackgroundBox>
            <Typography variant='h1' style={{whiteSpace: 'nowrap', margin:'5%'}}>
                산들바람 길잡이
            </Typography>
            <ImageStepper />
            <Button style={{marginTop:'5%', marginBottom: '10%'}}>
                시작하기
            </Button>
        </BackgroundBox>
    );
}

export default Landing;
